export const AUTH_LOGIN = 'AUTH_LOGIN';
export const AUTH_CHECK = 'AUTH_CHECK';
export const AUTH_LOGOUT = 'AUTH_LOGOUT';

export function authLogin(payload){
    return {
        type: AUTH_LOGIN,
        payload
    }
}


export function authLogout(){
    return {
        type: AUTH_LOGOUT
    }
}

export function authCheck(){
    return {
        type:AUTH_CHECK
    }
}
